#### Important Equations and Principles:
1. **Matrix Inversion**
   - For a matrix \( A \), the inverse \( A^{-1} \) satisfies \( AA^{-1} = I \).

2. **Rank and Nullity**
   - Rank-Nullity Theorem: \( \text{rank}(A) + \text{nullity}(A) = n \) for an \( m \times n \) matrix \( A \).

3. **Trace and Determinant**
   - Trace of a matrix \( A \): \( \text{trace}(A) = \sum_{i=1}^n a_{ii} \).
   - Determinant of a matrix \( A \): \( \det(A) \).

4. **Linear Transformations**
   - A linear transformation \( T: \mathbb{R}^n \to \mathbb{R}^m \) satisfies \( T(ax + by) = aT(x) + bT(y) \).

5. **Orthogonal Transformations**
   - Preserve the inner product: \( \langle Tu, Tv \rangle = \langle u, v \rangle \).
   - \( \det(Q) = \pm 1 \) for an orthogonal matrix \( Q \).

6. **Projection**
   - Projection of a vector \( v \) onto a vector \( u \): \( \text{proj}_u v = \left( \frac{u \cdot v}{u \cdot u} \right) u \).

7. **Gram-Schmidt Process**
   - Converts a set of vectors into an orthonormal set.

